import React from 'react';
import {useEffect} from 'react';
import xlsx from 'xlsx';

function App() {
  useEffect(()=>{
    xlsx.readFile('Products.xlsx');
  }, [])

  return (
    <div className="App">

      <input type="file" 
      name="XlFileLoader"
      id="XlFileLoader"
      accept="application/vnd.openxmlformats-officedocument.spreadsheetml.sheet" />

    </div>
  );
}

export default App;
